import react from 'react';

function Chimie() {
    return (
    <div className='chimie'>
        <h1>Chimie</h1>
        <articile class="cours">
            <p>4 ème</p>
            <p>3 ème</p>
            <p>Seconde</p>
            <p>Première</p>
            <p>Terminale</p>
            <p>Bac +1</p>
            <p>Bac +2</p>
        </articile>
    </div>
    );
}

export default Chimie;
